blocks.script:
install(
  '@nbook/md',
  '@nbook/plot',
  '@nbook/table',
  '@nbook/request',
  'lodash',
  'mingo',
  'papaparse'
);

var md = require('@nbook/md');
var plot = require('@nbook/plot');
var table = require('@nbook/table');
var request = require('@nbook/request');
var _ = require('lodash');
var mingo = require('mingo');
var Papa = require('papaparse');

const baseUrl = 'https://covid.ourworldindata.org/data/ecdc';

var { data: total_cases } = Papa.parse(request(`${baseUrl}/total_cases.csv`), { header: true });
var { data: total_deaths } = Papa.parse(request(`${baseUrl}/total_deaths.csv`), { header: true });
var { data: new_cases } = Papa.parse(request(`${baseUrl}/new_cases.csv`), { header: true });
var { data: new_deaths } = Papa.parse(request(`${baseUrl}/new_deaths.csv`), { header: true });

const START_DATE = '2020-02-25';
var data = new_cases.filter(entry => entry.date > START_DATE).map(entry => {
  return Object.keys(entry).reduce((res, key) => {
    const val = key === 'date' ? entry[key] : parseInt(entry[key] || 0, 10);
    return { ...res, [key]: val };
  }, {});
});

table(data, { columns: [ 'date', 'World', 'Argentina' ] });

const getCountryDataset = (country) => {
  return {
    label: country,
    data: data.map(data => data[country]),
    backgroundColor: `rgba(${Math.random() * 255}, ${Math.random() * 255}, ${Math.random() * 255}, 0.2)`,
    borderWidth: 1
  }
}

plot.line({
  labels: data.map(data => data.date),
  datasets: [
    getCountryDataset('Italy'),
    getCountryDataset('Germany'),
    getCountryDataset('United Kingdom'),
    getCountryDataset('United States'),
    getCountryDataset('Argentina'),
    getCountryDataset('Brazil'),
    getCountryDataset('China'),
    getCountryDataset('France'),
    getCountryDataset('Spain')
  ]
}, {
	scales: {
		xAxes: [{
			display: true,
		}],
		yAxes: [{
			display: true,
		}]
	}
})

Result.literal(await rp('http://ifconfig.me/'))
const asd = 123;
var qwe = 456;
